// ==UserScript==
// @name         Overlay Editor
// @namespace    http://tampermonkey.net/
// @author       Ryan-the-hito
// @version      2.9
// @description  Display a custom overlay text box above any editable element; Enter is invalid, Shift+Enter for line break, Cmd+Enter for write back, Cmd+Shift+Enter for write back and simulate submission.
// @match        *://*/*
// @icon         data:image/png;base64,
// @license      MIT
// @grant        none
// ==/UserScript==

(function () {
  'use strict';

  const DISABLED_DOMAINS = ['notion.so', 'notion.site'];
  const hostname = window.location.hostname;
  if (DISABLED_DOMAINS.some(domain => hostname === domain || hostname.endsWith(`.${domain}`))) {
    return;
  }

  const userAgent = navigator.userAgent || '';
  const vendor = navigator.vendor || '';
  const isIOS = /iP(ad|hone|od)/i.test(userAgent);
  const isAppleVendor = /Apple/i.test(vendor);
  const isLikelyWebKit = isIOS || isAppleVendor;
  const TWITTER_BASES = ['twitter.com', 'x.com'];
  const isTwitterDomain = TWITTER_BASES.some(base => hostname === base || hostname.endsWith(`.${base}`));
  const TW_CONTENTS_SELECTOR = '[data-contents="true"]';
  const TW_BLOCK_SELECTOR = '[data-block="true"]';
  const TW_TEXT_SELECTOR = 'span[data-text="true"]';

  /***********************
   * 工具与状态
   ***********************/
  const EDIT_TYPES = new Set(['text','search','email','url','password','number','tel']);
  const isEditable = (el) => {
    if (!el || el.disabled || el.readOnly) return false;
    if (el.tagName === 'TEXTAREA') return true;
    if (el.tagName === 'INPUT' && EDIT_TYPES.has((el.type || 'text').toLowerCase())) return true;
    if (el.isContentEditable) return true;
    return false;
  };
  const isSingleLine = (el) => el && el.tagName === 'INPUT';
  const clamp = (v, lo, hi) => Math.max(lo, Math.min(hi, v));
  const normalizeNewlines = (text) => (text || '').replace(/\r\n/g, '\n');

  const getSelectionSafe = () => (window.getSelection && window.getSelection()) || null;
  const ensureFocus = (el) => {
    if (!el) return;
    if (document.activeElement === el) return;
    try { el.focus({ preventScroll: true }); } catch {
      try { el.focus(); } catch {}
    }
  };

  const selectElementContents = (el) => {
    const selection = getSelectionSafe();
    if (!selection || !el) return false;
    try {
      const range = document.createRange();
      range.selectNodeContents(el);
      selection.removeAllRanges();
      selection.addRange(range);
      return true;
    } catch {
      return false;
    }
  };

  const collapseSelectionToEnd = (el) => {
    const selection = getSelectionSafe();
    if (!selection || !el) return;
    try {
      const range = document.createRange();
      range.selectNodeContents(el);
      range.collapse(false);
      selection.removeAllRanges();
      selection.addRange(range);
    } catch {}
  };

  const execCommand = (command, value = null) => {
    if (typeof document.execCommand !== 'function') return false;
    try {
      return document.execCommand(command, false, value);
    } catch {
      return false;
    }
  };

  const renderPlainTextInto = (el, text) => {
    if (!el) return false;
    const normalized = normalizeNewlines(text);
    const endsWithBreak = normalized.endsWith('\n');
    const lines = normalized.split('\n');
    const frag = document.createDocumentFragment();
    for (let i = 0; i < lines.length; i++) {
      const line = lines[i];
      if (line.length) frag.appendChild(document.createTextNode(line));
      if (i < lines.length - 1 || endsWithBreak) {
        frag.appendChild(document.createElement('br'));
      }
    }
    if (!frag.childNodes.length) {
      frag.appendChild(document.createElement('br'));
    }
    el.innerHTML = '';
    el.appendChild(frag);
    return true;
  };

  const trySequentialInsert = (el, text, { useParagraphBreaks = false } = {}) => {
    if (!el || typeof document.execCommand !== 'function') return false;
    const selection = getSelectionSafe();
    if (!selection) return false;
    ensureFocus(el);
    if (!selectElementContents(el)) return false;
    execCommand('delete');

    const normalized = normalizeNewlines(text);
    const lines = normalized.split('\n');
    const endsWithBreak = normalized.endsWith('\n');
    const breakCommand = useParagraphBreaks ? 'insertParagraph' : 'insertLineBreak';

    try {
      if (!normalized && !endsWithBreak) {
        execCommand('insertParagraph');
        collapseSelectionToEnd(el);
        return true;
      }

      for (let i = 0; i < lines.length; i++) {
        const line = lines[i];
        if (line.length) execCommand('insertText', line);
        if (i < lines.length - 1 || endsWithBreak) {
          if (!execCommand(breakCommand)) execCommand('insertParagraph');
        }
      }
      collapseSelectionToEnd(el);
      return true;
    } catch {
      return false;
    }
  };

  const compareTextContent = (el, expected) => {
    if (!el) return false;
    const actual = normalizeNewlines(el.innerText || el.textContent || '');
    const normalizeTrailing = (v) => v.replace(/\s+$/,'');
    return normalizeTrailing(actual) === normalizeTrailing(normalizeNewlines(expected));
  };

  const simulateNativePaste = (el, text) => {
    if (!el) return false;
    if (typeof ClipboardEvent !== 'function') return false;
    let dataTransfer = null;
    try {
      if (typeof DataTransfer === 'function') {
        dataTransfer = new DataTransfer();
        dataTransfer.setData('text/plain', text);
      }
    } catch {
      dataTransfer = null;
    }
    ensureFocus(el);
    if (!selectElementContents(el)) return false;
    try {
      const pasteEvent = new ClipboardEvent('paste', {
        bubbles: true,
        cancelable: true,
        clipboardData: dataTransfer || undefined,
      });
      if (dataTransfer && !pasteEvent.clipboardData) {
        Object.defineProperty(pasteEvent, 'clipboardData', {
          value: dataTransfer,
          writable: false,
        });
      }
      const defaultAllowed = el.dispatchEvent(pasteEvent);
      if (!defaultAllowed) return false;
      collapseSelectionToEnd(el);
      return compareTextContent(el, text);
    } catch {
      return false;
    }
  };

  const replaceTwitterContent = (el, text) => {
    if (!el) return false;
    const contents = el.querySelector(TW_CONTENTS_SELECTOR);
    if (!contents) return false;
    const templateBlock = contents.querySelector(TW_BLOCK_SELECTOR);
    if (!templateBlock) return false;
    const snapshot = Array.from(contents.childNodes).map(node => node.cloneNode(true));

    const linesRaw = normalizeNewlines(text);
    const lines = linesRaw.split('\n');
    if (linesRaw.endsWith('\n')) lines.push('');
    if (!lines.length) lines.push('');

    const fragment = document.createDocumentFragment();
    const baseKey = `overlay${Date.now().toString(36)}${Math.random().toString(36).slice(2, 6)}`;

    const makeOffsetKey = (index, depth = 0) => `${baseKey}-${index}-${depth}`;

    const createBlock = (lineText, index) => {
      const block = templateBlock.cloneNode(true);
      block.removeAttribute('data-placeholder');

      const offsetKey = makeOffsetKey(index, 0);
      block.setAttribute('data-offset-key', offsetKey);
      block.querySelectorAll('[data-offset-key]').forEach((node, depthIndex) => {
        node.setAttribute('data-offset-key', makeOffsetKey(index, depthIndex));
        node.removeAttribute('data-placeholder');
      });

      const textSpans = Array.from(block.querySelectorAll(TW_TEXT_SELECTOR));
      let span = textSpans.shift();
      if (!span) {
        span = document.createElement('span');
        span.setAttribute('data-text', 'true');
        const hostSpan = block.querySelector('[data-offset-key]') || block;
        hostSpan.appendChild(span);
      }
      textSpans.forEach(extra => extra.remove());

      while (span.firstChild) span.removeChild(span.firstChild);

      if (lineText && lineText.length) {
        span.textContent = lineText;
      } else {
        const br = document.createElement('br');
        br.setAttribute('data-text', 'true');
        span.appendChild(br);
      }

      return block;
    };

    try {
      while (contents.firstChild) contents.removeChild(contents.firstChild);
      lines.forEach((line, index) => {
        const block = createBlock(line, index);
        fragment.appendChild(block);
      });
      contents.appendChild(fragment);
      collapseSelectionToEnd(el);
      return compareTextContent(el, text);
    } catch {
      while (contents.firstChild) contents.removeChild(contents.firstChild);
      snapshot.forEach(node => contents.appendChild(node));
      return false;
    }
  };

  let target = null;               // 原网页输入框
  let enabled = true;              // 是否启用覆盖层
  let visible = false;             // 覆盖层是否显示
  let composing = false;           // IME 组合输入中
  let suppressClose = false;       // 防止一瞬间被外部点击逻辑关掉
  let justCommitted = false;       // 刚写回时，保护一下焦点
  let suppressNextShow = null;     // 提交后跳过一次聚焦触发
  let pointerEditableCandidate = null; // 指针预选的可编辑元素
  let pointerFallbackHandle = null;    // 指针候选清理定时器
  let pendingReposition = false;       // requestAnimationFrame 节流定位
  let forceNextReposition = false;
  const lastPlacement = { left: null, top: null, width: null, height: null, maxHeight: null };

  /***********************
   * 覆盖层（Shadow DOM）
   ***********************/
  const host = document.createElement('div');
  Object.assign(host.style, {
    all: 'initial',
    position: 'fixed',
    inset: '0',
    zIndex: '2147483647',
    pointerEvents: 'none',
  });
  document.documentElement.appendChild(host);

  const shadow = host.attachShadow({ mode: 'open' });
  const style = document.createElement('style');
  style.textContent = `
    :host { all: initial; }
    textarea#overlay {
      position: absolute;
      display: none;
      pointer-events: auto;

      box-sizing: border-box;
      font: 14px/1.5 system-ui, -apple-system, Segoe UI, Roboto, sans-serif;
      padding: 8px 10px;
      color: #111; background: #fff;
      border: 1px solid rgba(0,0,0,.18);
      border-radius: 8px;
      box-shadow: 0 8px 24px rgba(0,0,0,.18);
      outline: none;
      resize: vertical;

      white-space: pre-wrap;
      overflow-wrap: break-word;
      overflow: auto;

      min-width: 280px;  max-width: 640px;
      min-height: 40px;  max-height: 240px;
    }
  `;
  const overlay = document.createElement('textarea');
  overlay.id = 'overlay';
  overlay.setAttribute('autocomplete','off');
  overlay.setAttribute('autocapitalize','off');
  overlay.setAttribute('spellcheck','false');
  overlay.setAttribute('tabindex','0');
  shadow.append(style, overlay);

  /***********************
   * 全局开关按钮
   ***********************/
  const toggleContainer = document.createElement('div');
  Object.assign(toggleContainer.style, {
    all: 'initial',
    position: 'fixed',
    top: '28%',
    right: '24px',
    zIndex: '2147483647',
    pointerEvents: 'auto',
  });

  const toggleButton = document.createElement('button');
  toggleButton.type = 'button';
  Object.assign(toggleButton.style, {
    all: 'initial',
    font: '12px/1.4 system-ui, -apple-system, Segoe UI, Roboto, sans-serif',
    color: '#fff',
    background: 'rgba(68, 140, 255, 0.85)',
    padding: '8px 14px',
    borderRadius: '18px',
    border: '1px solid rgba(255,255,255,0.3)',
    boxShadow: '0 4px 14px rgba(0,0,0,0.18)',
    cursor: 'pointer',
    userSelect: 'none',
    pointerEvents: 'auto',
    transition: 'background 0.2s ease',
  });

  const syncToggleButton = () => {
    toggleButton.textContent = enabled ? 'Overlay 已开启' : 'Overlay 已关闭';
    toggleButton.setAttribute('aria-pressed', enabled ? 'true' : 'false');
    toggleButton.style.background = enabled ? 'rgba(68, 140, 255, 0.85)' : 'rgba(120, 120, 120, 0.85)';
  };

  toggleButton.addEventListener('click', (e) => {
    e.preventDefault();
    e.stopPropagation();
    enabled = !enabled;
    if (!enabled) {
      hideOverlay();
      clearPointerCandidate();
    }
    syncToggleButton();
  });

  toggleButton.addEventListener('mousedown', (e) => e.stopPropagation());
  toggleButton.addEventListener('mouseup',   (e) => e.stopPropagation());

  syncToggleButton();
  toggleContainer.appendChild(toggleButton);
  const appendToggle = () => {
    (document.body || document.documentElement).appendChild(toggleContainer);
  };
  if (document.readyState === 'loading') {
    document.addEventListener('DOMContentLoaded', appendToggle, { once: true });
  } else {
    appendToggle();
  }

  const isInOverlayShadow = (node) => !!node && node.getRootNode && node.getRootNode() === shadow;
  const isInToggleContainer = (node) => node instanceof Element && toggleContainer.contains(node);
  const hasShadowRoot = typeof ShadowRoot === 'function';

  function resolveEditable(node) {
    let cur = node;
    while (cur) {
      if (isInOverlayShadow(cur)) return null;
      if (hasShadowRoot && cur instanceof ShadowRoot) {
        cur = cur.host;
        continue;
      }
      if (cur instanceof Element) {
        if (isInToggleContainer(cur)) return null;
        if (isEditable(cur)) return cur;
      }
      if (cur && typeof cur.assignedSlot === 'object' && cur.assignedSlot) {
        cur = cur.assignedSlot;
        continue;
      }
      if (cur && cur.parentElement) {
        cur = cur.parentElement;
        continue;
      }
      if (cur && cur.parentNode) {
        const parent = cur.parentNode;
        if (hasShadowRoot && parent instanceof ShadowRoot) {
          cur = parent.host;
        } else {
          cur = parent;
        }
        continue;
      }
      const root = cur && cur.getRootNode && cur.getRootNode();
      if (hasShadowRoot && root instanceof ShadowRoot && root.host) {
        cur = root.host;
        continue;
      }
      break;
    }
    return null;
  }

  function resolveEditableFromPath(path) {
    if (!Array.isArray(path)) return null;
    for (const node of path) {
      if (!node) continue;
      if (isInOverlayShadow(node)) return null;
      if (node instanceof Element && isInToggleContainer(node)) return null;
      if (hasShadowRoot && node instanceof ShadowRoot) {
        const resolvedShadow = resolveEditable(node.host || null);
        if (resolvedShadow) return resolvedShadow;
        continue;
      }
      if (node instanceof Element) {
        const resolved = resolveEditable(node);
        if (resolved) return resolved;
      }
    }
    return null;
  }

  function clearPointerCandidate() {
    if (pointerFallbackHandle) {
      clearTimeout(pointerFallbackHandle);
      pointerFallbackHandle = null;
    }
    pointerEditableCandidate = null;
  }

  const targetResizeObserver = typeof ResizeObserver === 'function'
    ? new ResizeObserver(() => {
        if (!visible || !enabled) return;
        if (!target || !target.isConnected) {
          hideOverlay();
          return;
        }
        scheduleReposition();
      })
    : null;

  /***********************
   * 尺寸与定位
   ***********************/
  function applyOverlayPlacement(left, top, width, height, maxHeight, force = false) {
    if (force || lastPlacement.left !== left) {
      overlay.style.left = `${left}px`;
      lastPlacement.left = left;
    }
    if (force || lastPlacement.top !== top) {
      overlay.style.top = `${top}px`;
      lastPlacement.top = top;
    }
    if (force || lastPlacement.width !== width) {
      overlay.style.width = `${width}px`;
      lastPlacement.width = width;
    }
    if (force || lastPlacement.height !== height) {
      overlay.style.height = `${height}px`;
      lastPlacement.height = height;
    }
    if (force || lastPlacement.maxHeight !== maxHeight) {
      overlay.style.maxHeight = `${maxHeight}px`;
      lastPlacement.maxHeight = maxHeight;
    }
  }

  function positionOverlay({ force = false } = {}) {
    if (!visible || !target || !enabled) return;
    if (!target.isConnected) {
      hideOverlay();
      return;
    }

    let rect = target.getBoundingClientRect();
    if (rect && rect.width === 0 && rect.height === 0) {
      let ancestor = target.parentElement;
      while (ancestor) {
        if (ancestor === document.body || ancestor === document.documentElement) break;
        if (typeof ancestor.getBoundingClientRect === 'function') {
          const ar = ancestor.getBoundingClientRect();
          if (ar && (ar.width !== 0 || ar.height !== 0)) {
            rect = ar;
            break;
          }
        }
        ancestor = ancestor.parentElement;
      }
    }
    const vw = window.innerWidth;
    const vh = window.innerHeight;

    const baseW = rect.width || 320;
    const maxWidth = Math.min(640, Math.max(200, vw - 24));
    const width = clamp(Math.round(baseW), 200, maxWidth);

    const baseH = isSingleLine(target) ? 40 : Math.max(40, rect.height + 12);
    let height = clamp(Math.round(baseH), 40, 240);

    const viewportPad = 12;
    const margin = 6;
    const spaceBelow = vh - rect.bottom - margin;
    const spaceAbove = rect.top - margin;

    let top;
    let computedMaxHeight;
    if (spaceBelow >= height) {
      top = rect.bottom + margin;
      computedMaxHeight = Math.max(40, Math.min(240, spaceBelow));
    } else if (spaceAbove >= height) {
      height = clamp(height, 40, spaceAbove);
      top = rect.top - margin - height;
      computedMaxHeight = Math.max(40, Math.min(240, spaceAbove));
    } else {
      if (spaceBelow >= spaceAbove) {
        height = clamp(height, 40, Math.max(40, spaceBelow));
        top = rect.bottom + margin;
        computedMaxHeight = Math.max(40, Math.min(240, Math.max(40, spaceBelow)));
      } else {
        height = clamp(height, 40, Math.max(40, spaceAbove));
        top = rect.top - margin - height;
        computedMaxHeight = Math.max(40, Math.min(240, Math.max(40, spaceAbove)));
      }
    }

    const viewportHeightLimit = Math.max(40, vh - viewportPad * 2);
    height = clamp(height, 40, viewportHeightLimit);

    const maxTop = Math.max(viewportPad, vh - height - viewportPad);
    top = clamp(Math.round(top), viewportPad, maxTop);

    const availableBelow = Math.max(40, vh - top - viewportPad);
    if (height > availableBelow) {
      height = availableBelow;
    }
    const maxHeight = Math.min(computedMaxHeight || height, availableBelow);

    let left = rect.left;
    const maxLeft = Math.max(viewportPad, vw - width - viewportPad);
    left = clamp(Math.round(left), viewportPad, maxLeft);

    applyOverlayPlacement(
      Math.round(left),
      Math.round(top),
      width,
      height,
      maxHeight,
      force
    );
  }

  function scheduleReposition({ force = false } = {}) {
    if (!visible || !target || !enabled) return;
    if (force) forceNextReposition = true;
    if (pendingReposition) return;
    pendingReposition = true;
    requestAnimationFrame(() => {
      pendingReposition = false;
      const shouldForce = forceNextReposition;
      forceNextReposition = false;
      positionOverlay({ force: shouldForce });
    });
  }

  function showFor(el) {
    if (!enabled || !el) return;
    target = el;

    if (targetResizeObserver) {
      try { targetResizeObserver.disconnect(); } catch {}
      try { targetResizeObserver.observe(el); } catch {}
    }

    // 同步初始文本
    overlay.value = el.isContentEditable ? (el.textContent || '') : (el.value || '');
    overlay.style.display = 'block';
    visible = true;
    justCommitted = false;

    // 欺骗网页：让它以为原框仍被聚焦（很多站点据此屏蔽全局热键）
    try {
      el.dispatchEvent(new FocusEvent('focus',   { bubbles: true }));
      el.dispatchEvent(new FocusEvent('focusin', { bubbles: true }));
    } catch {}

    positionOverlay({ force: true });

    // 强力粘住焦点：无论发生什么，下一帧都把焦点拉回 overlay
    requestAnimationFrame(() => {
      overlay.focus({ preventScroll: true });
      const len = overlay.value.length;
      overlay.setSelectionRange(len, len);
    });
  }

  function hideOverlay() {
    if (targetResizeObserver) {
      try { targetResizeObserver.disconnect(); } catch {}
    }
    overlay.style.display = 'none';
    visible = false;
    target = null;
    composing = false;
    pendingReposition = false;
    forceNextReposition = false;
    lastPlacement.left = null;
    lastPlacement.top = null;
    lastPlacement.width = null;
    lastPlacement.height = null;
    lastPlacement.maxHeight = null;
  }

  /***********************
   * 写回逻辑（受控组件 & contenteditable）
   ***********************/
  function replaceContentEditable(el, text) {
    if (!el) return false;
    const normalized = normalizeNewlines(text);
    ensureFocus(el);

    if (isTwitterDomain) {
      if (replaceTwitterContent(el, normalized)) return true;
      if (simulateNativePaste(el, normalized)) return true;
      return false;
    } else if (isLikelyWebKit) {
      if (trySequentialInsert(el, normalized, { useParagraphBreaks: false }) && compareTextContent(el, normalized)) {
        return true;
      }
    }

    if (selectElementContents(el)) {
      if (execCommand('insertText', normalized)) {
        collapseSelectionToEnd(el);
        if (compareTextContent(el, normalized)) {
          return true;
        }
      }
    }

    if (!isTwitterDomain && renderPlainTextInto(el, normalized)) {
      collapseSelectionToEnd(el);
      if (compareTextContent(el, normalized)) {
        return true;
      }
    }

    try {
      el.textContent = normalized;
      collapseSelectionToEnd(el);
      return compareTextContent(el, normalized);
    } catch {
      return false;
    }
  }

  function writeBack() {
    if (!target) return;
    const val = overlay.value;

    if (target.isContentEditable) {
      replaceContentEditable(target, val);
      try {
        target.dispatchEvent(new InputEvent('input', { bubbles: true, cancelable: true, data: val, inputType: 'insertReplacementText' }));
      } catch {
        target.dispatchEvent(new Event('input', { bubbles: true }));
      }
      target.dispatchEvent(new Event('change', { bubbles: true }));
    } else {
      const proto = Object.getPrototypeOf(target);
      const desc = proto && Object.getOwnPropertyDescriptor(proto, 'value');
      if (desc && typeof desc.set === 'function') desc.set.call(target, val);
      else target.value = val;
      target.dispatchEvent(new Event('input', { bubbles: true }));
      target.dispatchEvent(new Event('change', { bubbles: true }));
    }
  }

  function triggerEnterOnElement(el) {
    if (!el) return;
    const keyCode = 13;
    const createEvent = (type) => {
      const event = new KeyboardEvent(type, {
        bubbles: true,
        cancelable: true,
        key: 'Enter',
        code: 'Enter',
        keyCode,
        which: keyCode,
        composed: true,
      });
      try {
        Object.defineProperty(event, 'keyCode', { get: () => keyCode });
        Object.defineProperty(event, 'which', { get: () => keyCode });
      } catch {}
      return event;
    };

    const keydownEvent = createEvent('keydown');
    const keydownPrevented = !el.dispatchEvent(keydownEvent) || keydownEvent.defaultPrevented;

    let keypressPrevented = true;
    if (!keydownPrevented) {
      const keypressEvent = createEvent('keypress');
      keypressPrevented = !el.dispatchEvent(keypressEvent) || keypressEvent.defaultPrevented;
    }

    el.dispatchEvent(createEvent('keyup'));

    const form = el.form;
    if (form) {
      const submit = () => {
        if (typeof form.requestSubmit === 'function') form.requestSubmit();
        else form.submit();
      };
      if (!keydownPrevented && !keypressPrevented) submit();
      else queueMicrotask(submit);
    }
  }

  function commitToTarget({ triggerEnter = false } = {}) {
    if (!target) return;
    const currentTarget = target;
    justCommitted = true;
    writeBack();
    hideOverlay();
    suppressNextShow = currentTarget;
    try { currentTarget.focus({ preventScroll: true }); } catch {}
    setTimeout(() => {
      if (suppressNextShow === currentTarget) suppressNextShow = null;
    }, 0);
    if (triggerEnter) triggerEnterOnElement(currentTarget);
  }

  /***********************
   * 指针辅助定位
   ***********************/
  document.addEventListener('pointerdown', (e) => {
    if (!enabled) return;
    if (typeof e.button === 'number' && e.button !== 0) {
      clearPointerCandidate();
      return;
    }
    const path = typeof e.composedPath === 'function' ? e.composedPath() : null;
    const candidate = resolveEditableFromPath(path || [e.target]);
    if (!candidate) {
      clearPointerCandidate();
      return;
    }
    pointerEditableCandidate = candidate;
    if (pointerFallbackHandle) clearTimeout(pointerFallbackHandle);
    pointerFallbackHandle = setTimeout(() => {
      pointerFallbackHandle = null;
      pointerEditableCandidate = null;
    }, 1500);
  }, true);

  document.addEventListener('pointerup', () => {
    if (!enabled) {
      clearPointerCandidate();
      return;
    }
    if (!pointerEditableCandidate) return;
    const candidate = pointerEditableCandidate;
    clearPointerCandidate();
    setTimeout(() => {
      if (!enabled) return;
      let el = resolveEditable(document.activeElement);
      if (!el && candidate && candidate.isConnected) {
        el = resolveEditable(candidate) || candidate;
      }
      if (!el) return;
      if (suppressNextShow === el) {
        suppressNextShow = null;
        return;
      }
      if (visible && el === target) {
        scheduleReposition();
        return;
      }
      showFor(el);
    }, 0);
  }, true);

  document.addEventListener('pointercancel', () => {
    clearPointerCandidate();
  }, true);

  /***********************
   * 进入原生输入时展示
   ***********************/
  document.addEventListener('focusin', (e) => {
    if (!enabled) {
      clearPointerCandidate();
      return;
    }
    let el = resolveEditable(e.target);
    if (!el && pointerEditableCandidate && pointerEditableCandidate.isConnected) {
      el = pointerEditableCandidate;
    }
    clearPointerCandidate();
    if (!el) return;
    if (suppressNextShow === el) {
      suppressNextShow = null;
      return;
    }
    if (visible && el === target) {
      scheduleReposition();
      return;
    }
    showFor(el);
  }, true);

  /***********************
   * 点击外部关闭（捕获）
   ***********************/
  document.addEventListener('mousedown', (e) => {
    if (!visible) return;

    const path = typeof e.composedPath === 'function' ? e.composedPath() : [];
    const insideOverlay = path.includes(overlay);
    const insideTarget  = target && path.includes(target);

    if (insideOverlay || insideTarget) {
      // 点击自身或原框：保持，并立即重新定位（页面可能滚动/变高）
      e.stopPropagation();
      suppressClose = true;
      queueMicrotask(() => { suppressClose = false; scheduleReposition(); });
      return;
    }
    if (!suppressClose) hideOverlay();
  }, true);

  /***********************
   * 绝对屏蔽“提交”
   ***********************/
  // 防止任何 form 在覆盖层可见时被提交（键盘或脚本触发）
  document.addEventListener('submit', (e) => {
    if (visible) {
      e.preventDefault();
      e.stopImmediatePropagation();
    }
  }, true);

  /***********************
   * 全局键盘隔离（捕获）
   ***********************/
  // 关键：在捕获阶段识别 Enter/Shift+Enter/Cmd+Enter 并先行处理
  // 这样即便页面在 target/Window 绑了监听，也拿不到
  ['keydown','keypress','keyup'].forEach(type => {
    window.addEventListener(type, (e) => {
      if (!visible || !enabled) return;
      if (!target || !target.isConnected) {
        hideOverlay();
        return;
      }
      // 只有当 overlay 真正在焦点上才拦截
      const hasFocus = shadow.activeElement === overlay || document.activeElement === overlay;
      if (!hasFocus) return;

      // 先阻断传播，避免任何网页监听执行
      e.stopImmediatePropagation();

      // ——特例控制——
      // 1) Shift+Enter：允许默认，让 overlay 换行
      if (type === 'keydown' && e.key === 'Enter' && e.shiftKey && !e.metaKey && !e.ctrlKey && !e.altKey) {
        return; // 不 preventDefault，让换行发生
      }

      // 2) 裸 Enter：彻底禁止
      if (type === 'keydown' && e.key === 'Enter' && !e.metaKey && !e.ctrlKey) {
        e.preventDefault(); // 阻止插入换行/提交
        return;
      }

      // 3) Cmd/Ctrl + Enter：写回并关闭；Cmd/Ctrl + Shift + Enter：写回后模拟一次 Enter
      if (type === 'keydown' && e.key === 'Enter' && (e.metaKey || e.ctrlKey)) {
        e.preventDefault(); // 阻止任何“提交”默认
        commitToTarget({ triggerEnter: e.shiftKey });
        return;
      }

      // 其余普通按键：不要 preventDefault，以免影响 overlay 输入；但传播已被阻断，网页拿不到
    }, true);
  });

  /***********************
   * IME 组合输入 & 焦点保活
   ***********************/
  overlay.addEventListener('compositionstart', () => { composing = true; });
  overlay.addEventListener('compositionend',   () => { composing = false; });

  // 焦点保活：任何 blur 都立即抢回焦点（除非刚刚提交或确实点到了外部）
  overlay.addEventListener('blur', () => {
    if (!visible || !enabled) return;
    if (!target || !target.isConnected) {
      hideOverlay();
      return;
    }
    if (justCommitted) { justCommitted = false; return; }
    // 小延迟反抢焦点，避免与页面脚本争抢时抖动
    setTimeout(() => {
      if (!visible || !enabled) return;
      if (!target || !target.isConnected) {
        hideOverlay();
        return;
      }
      // 如果用户在点外部，mousedown 捕获会先关掉，不会再抢
      try { overlay.focus({ preventScroll: true }); } catch {}
    }, 0);
  });

  // 防止页面脚本强行改焦点：当 selectionchange 但 overlay 不在焦点时，拉回
  document.addEventListener('selectionchange', () => {
    if (!visible || !enabled) return;
    if (!target || !target.isConnected) {
      hideOverlay();
      return;
    }
    if (document.activeElement !== overlay && shadow.activeElement !== overlay) {
      // 不在组合输入期间再拉回
      if (!composing) {
        try { overlay.focus({ preventScroll: true }); } catch {}
      }
    }
  }, true);

  /***********************
   * 覆盖层自身键处理（兜底）
   ***********************/
  overlay.addEventListener('keydown', (e) => {
    if (e.isComposing || composing) return;

    // 兜底：再确保三规则
    if (e.key === 'Enter' && e.shiftKey && !e.metaKey && !e.ctrlKey && !e.altKey) {
      // 允许默认换行
      e.stopImmediatePropagation();
      return;
    }
    if (e.key === 'Enter' && !e.metaKey && !e.ctrlKey) {
      e.preventDefault();
      e.stopImmediatePropagation();
      return;
    }
    if (e.key === 'Enter' && (e.metaKey || e.ctrlKey)) {
      e.preventDefault();
      e.stopImmediatePropagation();
      commitToTarget({ triggerEnter: e.shiftKey });
      return;
    }
    // 普通字符：不处理，但仍阻断传播，避免网页热键
    e.stopImmediatePropagation();
  });

  // 鼠标事件不往外冒泡
  ['mousedown','mouseup','click'].forEach(t => {
    overlay.addEventListener(t, (e) => e.stopPropagation());
  });

  /***********************
   * 跟随定位
   ***********************/
  const reposition = () => { if (visible && target) scheduleReposition(); };
  window.addEventListener('scroll', reposition, true);
  window.addEventListener('resize', reposition, { passive: true });
  const mo = new MutationObserver(() => reposition());
  mo.observe(document.documentElement, { childList: true, subtree: true, attributes: true, attributeFilter: ['style','class'] });

})();
